import NavDropdown from 'react-bootstrap/NavDropdown';
import { useNavigate, NavLink } from 'react-router-dom';
import "./Navbar.css"
const Navbar1 = () => {
    // const navigate = useNavigate();
    // const Home = () => { 
    //     navigate("/");
    // }
    // const Sch_meet = () => { 
    //     navigate("/sch_meet");
    // }
    // const Calender = () => { 
    //     navigate("/calender");
    // }
    return(
        <div className='nav_head' style={{ border: "2px solid red", margin:"0px"}}>
             <div className="navbar">
                <Navbar bg="red" expand="lg">
                    <Container>
                        <Navbar.Brand  className="heading1" href="#home">MYTIME</Navbar.Brand>
                        <Navbar.Toggle aria-controls="basic-navbar-nav" />
                        <Navbar.Collapse id="basic-navbar-nav">
                            <Nav className="me-auto">
                                {/* <Nav.Link onClick={Home}>Home</Nav.Link>
                                <Nav.Link onClick={Sch_meet}>Scheduled_Meeting</Nav.Link> 
                                 <Nav.Link onClick={Calender}>New_Meeting</Nav.Link> */}
                                
                    <NavLink className="item" to="/" >Home</NavLink>
                    <NavLink className="item" to="/calender" >New Meeting</NavLink>
                    <NavLink className="item" to="/sch_meet" >Scheduled Meet</NavLink>

                                

                            </Nav>
                        </Navbar.Collapse>
                    </Container>
                </Navbar>
            </div>
        </div>
    )
}
export default Navbar1;
